  false,\n\t\"url\": null,\n\t\"notes\": \"Prior to January 2004 the Complex was known
  as the Central Mississippi Refuge Complex and was comprised of 90,459 acres within
  the boundaries of 5 individual refuges and 43 Farmers Home Administration (FmHA)
  fee title and easement tracts, all located within the Lower Mississippi River Valley
  (LMRV). In January, 2004, the Consolidated Appropriations Act renamed the Complex
  to Theodore Roosevelt National Wildlife Refuge Complex, and added two new refuges.
  The new refuges are being assembled from FmHA lands already in U.S. Fish and Wildlife
  Service (Service) possession. The Bogue Phalia unit of the Yazoo National Wildlife
  Refuge (NWR) has been renamed the Holt Collier NWR, and the Theodore Roosevelt NWR
  is being created by selling or exchanging 6,600 acres of existing FHA tracts for
  land in the designated acquisition boundary. Only a small percentage of the land
  within the acquisition boundaries has actually been acquired to date.\",\n\t\"license_title\":
